import { Component } from '@angular/core';

@Component({
  templateUrl: './stats.component.html',
})
export class StatsComponent {}
<h1>Statistics Page</h1>
<div class="card-container">
    <div class="content" role="main">
        <div class="card">
            <a class="card" href="">Daily Visits</a>
            <a class="card" href="">Monthly Visits</a>
            <a class="card" href="">Database Storage</a>
            <a class="card" href="">Upload History</a>
        </div>
    </div>
</div>
